import React from 'react'
import FooterAluno from '../../components/footeraluno';
import HeaderAluno from '../../components/headeraluno';

const Dashboard = () => {
    return (
        <div>
            <HeaderAluno />
            <h1 className='text-center'> Tela em Desenvolvimento</h1>
            <FooterAluno />
        </div>
    )
}

export default Dashboard;
